import { Link } from "react-router-dom";

class Navbar extends Component {
    state = {
        isOpen: false
    };
    handleToggle = () => {
        this.setState({})
    }
  render() {
    return (
      <nav className="navbar navbar-expand-lg navbar-light bg-light">

      </nav>
    );
  }
}

export default Navbar;
